"use client";

import anime from "animejs";
import React, { useEffect } from "react";
import styled from "styled-components";

const StyledBody = styled.div`
	display: flex;
	justify-content: center;
	align-items: center;
	position: absolute;
	width: 100%;
	height: 100vh;
	background-color: #262626;
`;

const StyledAnimation = styled.div`
	flex: 1;
	max-width: 800px;
`;

const StyledPath = styled.path`
	fill: url(#sphereGradient);
	/* stroke-width: 1px; */
	stroke-width: 0.6px;
	stroke: rgba(80, 80, 80, 0.35);
	backface-visibility: hidden;
`;

function sphereAnimation() {
	var sphereEl: any = document.querySelector(".animation");
	var spherePathEls = sphereEl.querySelectorAll("svg > path");
	var pathLength = spherePathEls.length;
	var animations: any = [];

	// fitElementToParent(sphereEl);

	var breathAnimation = anime({
		begin: function () {
			for (var i = 0; i < pathLength; i++) {
				animations.push(
					anime({
						targets: spherePathEls[i],
						stroke: {
							// value: "rgba(255,75,75,1)",
							// value: ["rgba(255,75,75,1)", "rgba(80,80,80,.35)"],
							value: ["#0086cc", "#002766"],
							duration: 300,
						},
						strokeWidth: {
							value: [0.8, 0.4],
							duration: 100,
						},
						// translateX: [2, -4],
						translateY: [6, -6],
						easing: "linear",
						duration: 1000,
						autoplay: false,
					})
				);
			}
		},
		update: function (ins) {
			animations.forEach(function (animation: any, i: any) {
				var percent =
					(1 - Math.sin(i * 0.25 + 0.0006 * ins.currentTime)) / 2;
				animation.seek(animation.duration * percent);
			});
		},
		duration: Infinity,
		autoplay: false,
	});

	var introAnimation = anime
		.timeline({
			autoplay: false,
		})
		.add({
			targets: spherePathEls,
			strokeDashoffset: {
				value: [anime.setDashoffset, 0],
				duration: 3900,
				easing: "easeInOutCirc",
				delay: anime.stagger(190, { direction: "reverse" }),
			},
		});

	var shadowAnimation = anime({
		targets: "#sphereGradient",
		x1: "25%",
		x2: "25%",
		y1: "0%",
		y2: "75%",
		duration: 30000,
		easing: "easeOutQuint",
		autoplay: false,
	});

	function init() {
		introAnimation.play();
		breathAnimation.play();
		shadowAnimation.play();
	}

	init();
}

